import React from "react";

const MenuCard = ({ menuData }) => {
  return (
    <>
<section className="main-card--cointainer">
      {menuData.map((curr) => {
          const {id ,image,name,category,price,description}=curr;
        return (
          <>
            <div className="card-container">
              <div className="card">
                <div className="card-body">
                  <span className="card-number card-circle subtel">{id}</span>
                  <span className="card-author subtel">Breakfast</span>
                  <h2 className="card-title">Maggi</h2>
                  <span className="card-description subtel">
                    Made with a blend of finely ground and whole spices, and
                    herbs, the all new MAGGI Instant Noodles have a special and
                    flavourful tastemaker sachet inside. These spices have been
                    roasted to perfection, providing a distinct aroma and colour
                    to your MAGGI noodles.
                  </span>
                  <div className="card-read">Read</div>
                </div>
                <span className="card-tag subtel">Order Now</span>
              </div>
            </div>
          </>
        );
      })}
      </section>
    </>
  );
};

export default MenuCard;
